[{"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "Erdheim-Chester disease", "limit": 10}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mesh", "sparql_query": "PREFIX meshv: <http://id.nlm.nih.gov/mesh/vocab#>
