[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX bacdive: <http://bacdive.dsmz.de/rdfs/>

SELECT (COUNT(DISTINCT ?strain) AS ?count)
WHERE {
  ?strain rdf:type bacdive:Strain .
  ?strain bacdive:hasTemperatureRange ?tempRange .
  ?tempRange bacdive:temperatureMaximum ?maxTemp .
  FILTER(?maxTemp > 70)
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?strain) AS ?count)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain .
  ?temp a schema:CultureTemperature ;
        schema:describesStrain ?strain ;
        schema:hasTemperatureRangeEnd ?tempEnd .
  FILTER(?tempEnd > 70)
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?strain ?label ?genus ?species ?tempStart ?tempEnd
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?label ;
          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .
  ?temp a schema:CultureTemperature ;
        schema:describesStrain ?strain ;
        schema:hasTemperatureRangeStart ?tempStart ;
        schema:hasTemperatureRangeEnd ?tempEnd .
  FILTER(?tempEnd > 70)
}
ORDER BY DESC(?tempEnd)
LIMIT 20
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pubchem"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubchem", "sparql_query": "PREFIX vocab: <http://rdf.ncbi.nlm.nih.gov/pubchem/vocabulary#>
