  # Get entities in the mTOR signalling pathway
  <http://www.reactome.org/biopax/72/48887#Pathway1149> bp:pathwayComponent* ?component .

  ?component bp:participant ?entity .

  # Get proteins
  ?entity a bp:Protein ;
          bp:entityReference ?proteinRef .

  ?proteinRef bp:xref ?xref .
  ?xref a bp:UnificationXref ;
        bp:db "UniProt" ;
        bp:id ?uniprotAcc .

  OPTIONAL { ?entity bp:displayName ?displayName }

  BIND(?entity as ?protein)
}
